"""
参数一是个列表，其中两个元素的和为参数二；任务是找到这两个元素的index以列表的形式返回。
输入将始终有效（数字将是长度为2或更大的数组，所有项目均为数字；目标将始终是该数组中两个不同项目的总和）。
"""


# 第一种，双循环
def two_sum_common(nums, t):
    for i, x in enumerate(nums):
        for j, y in enumerate(nums):
            if i != j and x + y == t:
                return [i, j]


# 第二种，单循环，但是需要循环到两个加数的第二个
def two_sum_other(nums, target):
    d = {}
    for i, num in enumerate(nums):
        diff = target - num
        if diff in d:
            return [d[diff], i]
        d[num] = i


# 第三种，在找到第一个加数的时候就停止了
def two_sum(numbers, target):
    for i, v in enumerate(numbers):
        numbers[i] = ''
        if target - v in numbers:
            return [i, numbers.index(target - v)]


